SET statement_timeout = 0;
SET lock_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;

CREATE EXTENSION postgis;

CREATE SCHEMA planning;

SET search_path = "planning", pg_catalog;
SET default_tablespace = '';
SET default_with_oids = false;

CREATE TABLE "applications_all_data" (
    "id" integer NOT NULL,
    "caseurl" "text",
    "geopointlicensingurl" "text",
    "publicconsultationstartdate" "text",
    "responsesfor" "text",
    "locationtext" "text",
    "agent" "text",
    "geoy" numeric,
    "geox" numeric,
    "decisiontargetdate" "date",
    "responsesagainst" "text",
    "geoareauri" "text",
    "organisationlabel" "text",
    "decision" "text",
    "servicetypeuri" "text",
    "classificationlabel" "text",
    "casereference" "text",
    "decisiontype" "text",
    "status_id" integer,
    "casetext" "text",
    "extractdate" "text",
    "publisherlabel" "text",
    "publicconsultationenddate" "date",
    "servicetypelabel" "text",
    "organisationuri" "text",
    "uprn" character varying(12),
    "publisheruri" "text",
    "appealdecision" "text",
    "classificationuri" "text",
    "coordinatereferencesystem" "text",
    "casedate" "date",
    "geoarealabel" "text",
    "decisionnoticedate" "date",
    "groundarea" "text",
    "decisiondate" "date",
    "appealref" "text",
    "gsscode_id" integer,
    "wkb_geometry" "public"."geometry" NOT NULL
);

CREATE SEQUENCE "all_data_id_seq"
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "all_data_id_seq" OWNED BY "applications_all_data"."id";


CREATE TABLE "applications_statuses" (
    "id" integer NOT NULL,
    "api_lookup" character(20) NOT NULL,
    "description" "text" NOT NULL
);

CREATE SEQUENCE "application_statuses_id_seq"
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "application_statuses_id_seq" OWNED BY "applications_statuses"."id";


CREATE TABLE "areas" (
    "id" integer NOT NULL,
    "gss_code" character(9) NOT NULL,
    "name" "text" NOT NULL,
    "organisationuri" "text"
);

CREATE SEQUENCE "areas_id_seq"
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "areas_id_seq" OWNED BY "areas"."id";


ALTER TABLE ONLY "applications_all_data" ALTER COLUMN "id" SET DEFAULT "nextval"('"all_data_id_seq"'::"regclass");
ALTER TABLE ONLY "applications_statuses" ALTER COLUMN "id" SET DEFAULT "nextval"('"application_statuses_id_seq"'::"regclass");
ALTER TABLE ONLY "areas" ALTER COLUMN "id" SET DEFAULT "nextval"('"areas_id_seq"'::"regclass");


SELECT pg_catalog.setval('"all_data_id_seq"', 1087, true);
SELECT pg_catalog.setval('"application_statuses_id_seq"', 9, true);
SELECT pg_catalog.setval('"areas_id_seq"', 11, true);

