    ADD CONSTRAINT "application_statuses_api_lookup_key" UNIQUE ("api_lookup");

ALTER TABLE ONLY "applications_statuses"
    ADD CONSTRAINT "application_statuses_pkey" PRIMARY KEY ("id");

ALTER TABLE ONLY "applications_all_data"
    ADD CONSTRAINT "applications_all_data_pkey" PRIMARY KEY ("id");

ALTER TABLE ONLY "areas"
    ADD CONSTRAINT "areas_gsscode_key" UNIQUE ("gss_code");

ALTER TABLE ONLY "areas"
    ADD CONSTRAINT "areas_pkey" PRIMARY KEY ("id");


CREATE INDEX "applications_all_data_casedate_idx" ON "applications_all_data" USING "btree" ("casedate");
